(62, 23, 'paragraph_1', 'Established in 1985, MM Plastic Udhyog Pvt. Ltd. is now one of the most renowned and oldest Pet Preform manufacturer of Nepal. Ourlarge range of products and assured quality has made us the first choice of many industries for packing ghee, oil, water, squash, pickles, tea, engine oils, grease etc. We produce probably the biggest range of PE jars, jerrycanes, caps and closures including inners and measuring caps for pharmaceuticals in Nepal.  We also produces HDPE pipes and PVC pipes and profiles.'),
(63, 23, '_paragraph_1', 'field_5e206cefd0e4b'),
(64, 36, 'paragraph_1', 'Established in 1985, MM Plastic Udhyog Pvt. Ltd. is now one of the most renowned and oldest Pet Preform manufacturer of Nepal. Ourlarge range of products and assured quality has made us the first choice of many industries for packing ghee, oil, water, squash, pickles, tea, engine oils, grease etc. We produce probably the biggest range of PE jars, jerrycanes, caps and closures including inners and measuring caps for pharmaceuticals in Nepal.  We also produces HDPE pipes and PVC pipes and profiles.'),
(65, 36, '_paragraph_1', 'field_5e206cefd0e4b'),
(66, 23, 'paragraph_2', 'MM Plastic’s goal is to add value to its customers by establishing long-term strategic business partnerships in the region by supplying premium products and services in the rigid plastic packaging field. MM Plastic Udhyog Pvt. Ltd. has installed the first and the only single stretch PET blow molding machine from ASB Nissei Limited in Nepal to supply high quality hygienic PET bottles to the pharmaceutical industries of Nepal. '),
(67, 23, '_paragraph_2', 'field_5e206e12022e8'),
(68, 38, 'paragraph_1', 'Established in 1985, MM Plastic Udhyog Pvt. Ltd. is now one of the most renowned and oldest Pet Preform manufacturer of Nepal. Ourlarge range of products and assured quality has made us the first choice of many industries for packing ghee, oil, water, squash, pickles, tea, engine oils, grease etc. We produce probably the biggest range of PE jars, jerrycanes, caps and closures including inners and measuring caps for pharmaceuticals in Nepal.  We also produces HDPE pipes and PVC pipes and profiles.'),
(69, 38, '_paragraph_1', 'field_5e206cefd0e4b'),
