(71, 38, '_paragraph_2', 'field_5e206e12022e8'),
(72, 39, '_edit_last', '1'),
(73, 39, '_edit_lock', '1580230572:1'),
(74, 19, '_edit_last', '1'),
(75, 19, 'paragraph_1', 'We have installed the first and the only single stretch PET blow molding machine from ASB Nissei Limited in Nepal to supply high quality hygienic PET bottles to the pharmaceutical industries of Nepal. We have installed plastic blow, extrusion and injection molding machines from the top suppliers of the region like ASB Nissei, Ferromatik Milacron, Toshiba, Electronica, Universal Machineries and so on.'),
(76, 19, '_paragraph_1', 'field_5e206eba5f14c'),
(77, 19, 'paragraph_2', ''),
