(86, 17, 'paragraph_1', 'We carry out various quality checks to ensure top quality of products. Apart from visual inspection, weight tests, dimensional tests, leak tests and polariscope tests are carried out daily. High quality testing equipment are used to ensure consistent and accurate test results.'),
